/**
 * Custom Fonts - Embedded Base64
 * Fonts are embedded directly for maximum compatibility with jsPDF
 */

const FONT_REGULAR_BASE64 = '';
const FONT_BOLD_BASE64 = '';

export const registerPDFFonts = async (jsPDFInstance: any): Promise<void> => {
  try {
    // Add fonts to jsPDF's VFS (Virtual File System)
    jsPDFInstance.addFileToVFS('CustomFont-Regular.ttf', FONT_REGULAR_BASE64);
    jsPDFInstance.addFileToVFS('CustomFont-Bold.ttf', FONT_BOLD_BASE64);

    // Register the fonts
    jsPDFInstance.addFont('CustomFont-Regular.ttf', 'CustomFont', 'normal');
    jsPDFInstance.addFont('CustomFont-Bold.ttf', 'CustomFont', 'bold');

    console.log(' Custom fonts registered successfully');
  } catch (error) {
    console.error(' Error registering fonts:', error);
  }
};

export const getActiveFontName = (): string => {
  return 'CustomFont';
};

export const getFallbackFontName = (): string => {
  return 'helvetica';
};

export const getFontFaceCSS = (): string => {
  return `
    @font-face {
      font-family: 'CustomFont';
      src: url('/fonts/CustomFont-Regular.ttf') format('truetype');
      font-weight: normal;
    }
    @font-face {
      font-family: 'CustomFont';
      src: url('/fonts/CustomFont-Bold.ttf') format('truetype');
      font-weight: bold;
    }
  `;
};
